Content:
Hi @Leo Young account balance is already visible in the beta version and transactions related to the address are visible in the /transactions tab in contract details.
for exmaple:
https://beta.voyager.online/contract/0x064d416277dacf31db7aaab689c84539f31c5ed658f4bcbe15a17face132337d#transactions

@distracteddev 
I looked at the contract and the function that you mentioned above and everything is fine. Let me elaborate:
`get_tokens` function is:
`{
     "inputs": [
          {
               "name": "certificate_id",
               "type": "Uint256"
          }
     ],
     "name": "get_tokens",
     "outputs": [
          {
               "name": "tokens_len",
               "type": "felt"
          },
          {
               "name": "tokens",
               "type": "Token *"
          }
     ],
     "stateMutability": "view",
     "type": "function"
},`
as the output of this function is `tokens_len` of `felt` type and `tokens` of `Token*` type
where the `Token` structure looks like this:
`{
     "members": [
          {
               "name": "token_standard",
               "offset": 0,
               "type": "felt"
          },
          {
               "name": "token",
               "offset": 1,
               "type": "felt"
          },
          {
               "name": "token_id",
               "offset": 2,
               "type": "Uint256"
          },
          {
               "name": "amount",
               "offset": 4,
               "type": "Uint256"
          }
     ],
     "name": "Token",
     "size": 6,
     "type": "struct"
}`

so finally as the output we have: `tokens_len` and structure `Token` (token_standard (felt), token (felt), token_id (Uint256), amount (Uint256))
The output data is:
0: "0x1"
1: "0x1"
2: "0x7ecb8571cdcfa12d5f3869eb154e093abfd8ef97c93b97fb5c9ed33806831d5"
3: "0x8"
4: "0x0"
5: "0x0"
6: "0x0"

So finally we have:
0: "0x1" `tokens_len`
1: "0x1" `token_standard`
2: "0x7ecb8571cdcfa12d5f3869eb154e093abfd8ef97c93b97fb5c9ed33806831d5" `token`
3: "0x8" `token_id` 
4: "0x0" `token_id`
5: "0x0" `amount`
6: "0x0" `amount`
